import React from 'react';

class Order extends React.Component {
  render() {
    return(
      <div>
        <div>
          <p>Order status: Pending.</p>
        </div>

        <div>
          <p>Order Code: ABC123</p>
        </div>

        <div>
          Order name: Jorge Chirinos
        </div>

        <div>
          App: Uber eats
        </div>
      </div>
    )
  }
}

export default Order;
